#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>

int isRepeatChar(char* s, int begin, int len)
{
    for (int i = begin; i < len; i++) {
        for (int j = i + 1; j < len; j++) {
            if (s[i] == s[j])
                return 1;
        }
    }
    return 0;
}

int lengthOfLongestSubstring(char* s)
{
    int len_max = 0;
    int match;
    int len_s = strlen(s);
    if(len_s)
        len_max = 1;
    for (int begin = 0; begin < len_s; begin++) {
        for (int len = len_max; len < len_s - begin + 1; len++) {
            match = 0;
            if (!isRepeatChar(s, begin, len))
                len_max = len;
        }
    }
    return len_max;
}

